export default {
    "select": {
        "title": "title",
        "untitled": "untitled",
        "description": "description"
    },
    prepare({formData, formContext}) {
        const localeId = "locale:no"
        const title = formData.title && formData.title[localeId]

        const sectionType = formData.sectionType
        const untitled = "Untitled " + sectionType

        let description;

        if (sectionType === "text") {
            description = formData.bodytext && formData.bodytext[localeId]
        }

        if (sectionType === "media") {
            description = formData.media && formData.media.length + " media"
        }

        if (sectionType === "dm") {
            description = formData.references && formData.references.length + " referanser"
        }

        if (sectionType === "links") {
            description = formData.links && formData.links.length + " lenker"
        }

        if (sectionType === "attachments") {
            description = formData.attachments && formData.attachments.length + " vedlegg"
        }

        if (sectionType === "quote") {
            description = formData.cite + ": " + formData.quote && formData.quote[localeId]
        }

        return {
            title: title,
            untitled: untitled,
            description: description
        }

    }
}
